Actionscript.script:
count = 0;
_root.Starnamenum = 20;
_root.AreaTextClipF("Boo's Mansion:"+newline+"<i>Secret of the Library</i>", 3);
stop();
onEnterFrame = function () {
	if (count<48) {
		_root.PauseGame = false;
		_root.Camspeed = 2;
		_root.Camcenter = star;
		_root.playpause = true;
		count++;
	} else {
		if (count<150) {
			_root.PauseGame = false;
			count++;
			_root.playpause = true;
			_root.MaxCamspeed = 35;
			_root.Camspeed = 30;
		} else {
			_root.playpause = false;
			nextFrame();
			_root.warpframe = false;
			onEnterFrame = null;
		}
	}
};

onClipEvent (load) {
	_visible = false;
}
onClipEvent (enterFrame) {
	if (this.hitTest(_root.Course.Char.charClip.body)) {
		if (_root.PauseGame == false && _root.playpause == false) {
			//_root.Course.Char.yspeed = _root.groundFriction(_root.Course.Char.yspeed, 0.015, 1.001);
			if (savezoom == undefined) {
				savezoom = _root.CameraZoom;
			}
			if (_root.CameraZoom>90) {
				_root.CameraZoom -= 1;
			}
		}
	} else {
		if (savezoom !== undefined) {
			if (_root.CameraZoom<savezoom) {
				_root.CameraZoom += 1;
			} else {
				savezoom = undefined;
			}
		}
	}
}

